import React from 'react'
import "../element/element.css"
import { Fragment } from 'react';

export default function element() {
  const scroll = (e)=>{
    console.log(e);
  }

  return (
    <Fragment>
          <div onScroll={scroll}>
            bonjour
          </div>
          <p>
            hello
          </p>
    </Fragment>
  )
}
